package at.hb.photomanager.main.api.impl;

import at.hb.photomanager.api.PmApi;
import at.hb.photomanager.dto.PmDirectoryDto;
import at.hb.photomanager.dto.PmFileBaseDto;
import at.hb.photomanager.dto.PmPictureDto;
import at.hb.photomanager.main.service.PmService;
import at.hb.photomanager.utils.PageDto;
import at.hb.photomanager.utils.SearchRequest;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.RestController;

import java.util.ArrayList;
import java.util.List;

/**
 * @author blascheh
 */
@RestController
public class PmApiImpl implements PmApi {

    private final PmService pmService;

    @Autowired
    public PmApiImpl(PmService pmService) {
        this.pmService = pmService;
    }

    @Override
    public PmPictureDto getPicture(Long id) {
        PmPictureDto pmPictureDto = new PmPictureDto();
        pmPictureDto.setFilename("filename");
        return pmPictureDto;
    }

    @Override
    public PageDto<PmPictureDto> loadPicturePage(SearchRequest searchRequest) {
        List<PmPictureDto> elements = new ArrayList<>();
        //for (int i = 0; i < searchRequest.getSize(); i++) {
        for (int i = 0; i < 2; i++) {
            PmPictureDto pmPictureDto = new PmPictureDto();
            pmPictureDto.setFilename("filename" + i);
            pmPictureDto.setId(new Long(i));
            elements.add(pmPictureDto);
        }
        long totalCount = searchRequest.getSize() * 10;
        return new PageDto<>(elements, totalCount);
    }

    @Override
    public String loadPhoto(Long id) {
        String retval =  pmService.getBase64("testbilder/bild1.jpg");
        return retval;
        //return "data:image/jpeg;base64,";
    }

    @Override
    public List<PmFileBaseDto> getDirectories(PmDirectoryDto parentDirectory) {
        return pmService.getDirectories(parentDirectory);
    }

}
